const Login = () => {

  const [test, setTest] = useState([1,"1",true,undefined,3])

    const sum = (a : number, b : number) : number => {
        return a + b
    }

  const handle = () => {
    if(test[0] === 1){
      console.log('hi')
    }
  }

  console.log(test.map(el => el + 1))


  return (
    <div>
        <p>login : {sum(5, 10)}</p>
        <p onClick={() => handle()}>{test.map(el => el)}</p>
    </div>
  )
}

export default Login
